webpackJsonp([0xdc102cd5ad7a],{3331:function(t,e){t.exports={pathContext:{docHtml:'<p><a href="https://travis-ci.org/Microsoft/TypeScript"><img src="https://travis-ci.org/Microsoft/TypeScript.svg?branch=master" alt="Build Status"></a>\n<a href="https://www.npmjs.com/package/typescript"><img src="https://badge.fury.io/js/typescript.svg" alt="npm version"></a>\n<a href="https://www.npmjs.com/package/typescript"><img src="https://img.shields.io/npm/dm/typescript.svg" alt="Downloads"></a></p>\n<h1>TypeScript</h1>\n<p><a href="https://gitter.im/Microsoft/TypeScript?utm_source=badge&#x26;utm_medium=badge&#x26;utm_campaign=pr-badge&#x26;utm_content=badge"><img src="https://badges.gitter.im/Join%20Chat.svg" alt="Join the chat at https://gitter.im/Microsoft/TypeScript"></a></p>\n<p><a href="https://www.typescriptlang.org/">TypeScript</a> is a language for application-scale JavaScript. TypeScript adds optional types, classes, and modules to JavaScript. TypeScript supports tools for large-scale JavaScript applications for any browser, for any host, on any OS. TypeScript compiles to readable, standards-based JavaScript. Try it out at the <a href="https://www.typescriptlang.org/play/">playground</a>, and stay up to date via <a href="https://blogs.msdn.microsoft.com/typescript">our blog</a> and <a href="https://twitter.com/typescriptlang">Twitter account</a>.</p>\n<h2>Installing</h2>\n<p>For the latest stable version:</p>\n<pre><code class="language-bash">npm install -g typescript\n</code></pre>\n<p>For our nightly builds:</p>\n<pre><code class="language-bash">npm install -g typescript@next\n</code></pre>\n<h2>Contribute</h2>\n<p>There are many ways to <a href="https://github.com/Microsoft/TypeScript/blob/master/CONTRIBUTING.md">contribute</a> to TypeScript.</p>\n<ul>\n<li><a href="https://github.com/Microsoft/TypeScript/issues">Submit bugs</a> and help us verify fixes as they are checked in.</li>\n<li>Review the <a href="https://github.com/Microsoft/TypeScript/pulls">source code changes</a>.</li>\n<li>Engage with other TypeScript users and developers on <a href="https://stackoverflow.com/questions/tagged/typescript">StackOverflow</a>. </li>\n<li>Join the <a href="https://twitter.com/#!/search/realtime/%23typescript">#typescript</a> discussion on Twitter.</li>\n<li><a href="https://github.com/Microsoft/TypeScript/blob/master/CONTRIBUTING.md">Contribute bug fixes</a>.</li>\n<li>Read the language specification (<a href="https://github.com/Microsoft/TypeScript/blob/master/doc/TypeScript%20Language%20Specification.docx?raw=true">docx</a>,\n<a href="https://github.com/Microsoft/TypeScript/blob/master/doc/TypeScript%20Language%20Specification.pdf?raw=true">pdf</a>, <a href="https://github.com/Microsoft/TypeScript/blob/master/doc/spec.md">md</a>).</li>\n</ul>\n<p>This project has adopted the <a href="https://opensource.microsoft.com/codeofconduct/">Microsoft Open Source Code of Conduct</a>. For more information see\nthe <a href="https://opensource.microsoft.com/codeofconduct/faq/">Code of Conduct FAQ</a> or contact <a href="mailto:opencode@microsoft.com">opencode@microsoft.com</a>\nwith any additional questions or comments.</p>\n<h2>Documentation</h2>\n<ul>\n<li><a href="https://www.typescriptlang.org/docs/tutorial.html">Quick tutorial</a></li>\n<li><a href="https://www.typescriptlang.org/docs/handbook/basic-types.html">Programming handbook</a></li>\n<li><a href="https://github.com/Microsoft/TypeScript/blob/master/doc/spec.md">Language specification</a></li>\n<li><a href="https://www.typescriptlang.org/">Homepage</a></li>\n</ul>\n<h2>Building</h2>\n<p>In order to build the TypeScript compiler, ensure that you have <a href="https://git-scm.com/downloads">Git</a> and <a href="https://nodejs.org/">Node.js</a> installed.</p>\n<p>Clone a copy of the repo:</p>\n<pre><code class="language-bash">git clone https://github.com/Microsoft/TypeScript.git\n</code></pre>\n<p>Change to the TypeScript directory:</p>\n<pre><code class="language-bash">cd TypeScript\n</code></pre>\n<p>Install Gulp tools and dev dependencies:</p>\n<pre><code class="language-bash">npm install -g gulp\nnpm install\n</code></pre>\n<p>Use one of the following to build and test:</p>\n<pre><code>gulp local            # Build the compiler into built/local \ngulp clean            # Delete the built compiler \ngulp LKG              # Replace the last known good with the built one.\n                      # Bootstrapping step to be executed when the built compiler reaches a stable state.\ngulp tests            # Build the test infrastructure using the built compiler. \ngulp runtests         # Run tests using the built compiler and test infrastructure. \n                      # You can override the host or specify a test for this command. \n                      # Use host=&#x3C;hostName> or tests=&#x3C;testPath>. \ngulp runtests-browser # Runs the tests using the built run.js file. Syntax is gulp runtests. Optional\n                        parameters \'host=\', \'tests=[regex], reporter=[list|spec|json|&#x3C;more>]\'.\ngulp baseline-accept  # This replaces the baseline test results with the results obtained from gulp runtests.\ngulp lint             # Runs tslint on the TypeScript source.\ngulp help             # List the above commands. \n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-bash">node built/local/tsc.js hello.ts\n</code></pre>\n<h2>Roadmap</h2>\n<p>For details on our planned features and future direction please refer to our <a href="https://github.com/Microsoft/TypeScript/wiki/Roadmap">roadmap</a>.</p>',docPath:"argo-ci/node_modules/typescript/readme",proj:"argo-ci"}}}});
